  false,\n\t\"url\": null,\n\t\"notes\": \"The Oregon Department of Geology & Mineral
  Industries (DOGAMI) contracted with Watershed Sciences, Inc. to collect high resolution
  topographic LiDAR data for multiple areas within the State of Oregon. The areas
  for LiDAR collection have been designed as part of a collaborative effort of state,
  federal, and local agencies in order to meet a wide range of project goals. This
  LiDAR data set was collected in 7 delivery areas from January 3 through July 14,
  2010 and encompasses portions of the following counties in Oregon: Lincoln, Polk,
  Tillamook and Yamhill. This data set consists of bare earth and unclassified points.
  The average point density is 9.17 points per square meter over terrestrial surfaces.
  In some areas of heavy vegetation or forest cover, there may be relatively few ground
  points in the LiDAR data. Elevation values for open water surfaces are not valid
  elevation values because few LiDAR points are returned from water surfaces. LiDAR
  intensity values were also collected. This LiDAR data set was collected on different
  dates and organized into 7 deliveries. To determine which delivery or deliveries
  are in your area of interest, download yambo_deliveries.pdf at: https://coast.noaa.gov/htdata/lidar1_z/geoid12a/data/1077/supplemental/yambo_deliveries.pdf
  The specific date of collection and total area covered for each delivery are listed
  below. Delivery 1: Date of Collection: 20100414 Total Area = 10,760 sq acres Delivery
  2: Date of Collection: 20100301-20100605 Total Area = 62,451 sq acres Delivery 3:
  Date of Collection: 20100507-20100714 Total Area = 122,938 sq acres Delivery 4:
  Date of Collection: 20100103-20100527 Total Area = 97,317 sq acres Delivery 5: Date
  of Collection: 20100103-20100527 Total Area = 147,839 sq acres Delivery 6: Date
  of Collection: 20100305-20100515 Total Area = 84,277 sq acres Delivery 7: Date of
  Collection: 20100317-20100714 Total Area = 167,271 sq acres\",\n\t\"license_title\":
